import React, {useState, useEffect} from "react";

const CustomerProfile = ({id, customerID}) => {

  const [profile, setProfile] = useState([])
  useEffect(function(){

    fetch('https://cyf-react.glitch.me/customers/'+{customerID})

    .then(function(response) {
      return response.json()
    })
    .then(function(data){
      console.log('This data for the CP', data);
      setProfile(data)
    })
  }, []
  )
  console.log('useEffect customer id', {customerID});
  return (
    <div>
      <p>"Customer Profile":{id} </p>
    </div>
  );
};

export default CustomerProfile;
